import React, { useState } from 'react';
import styled from 'styled-components';
import Board from './components/Board';

const AppContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  margin-top: 20px;
`;

const Title = styled.h1`
  font-size: 24px;
  margin-bottom: 20px;
`;

const App: React.FC = () => {
  return (
    <AppContainer>
      <Title>Бесконечные крестики нолики</Title>
      <Board />
    </AppContainer>
  );
};

export default App;
